import React from 'react';

function Carusele({ text }) {
	return (
		<>
			<div>
				<div>{text}</div>
				<div></div>
			</div>
			<div>
				<div>1</div>
				<div>2</div>
				<div>3</div>
			</div>
		</>
	);
}

export default Carusele;
